import React from "react";
import { useEffect } from "react";

const Logout = () => {
    useEffect(() => {
        fetch('/logout', {
            method: 'GET',
            headers: {
                "Accept": "application/json",
                "Content-Type": "application/json"
            },
            credentials: 'include'
        });
    });



    return(
        <div>
            <h1>Logout</h1>
        </div>
    );
}

export default Logout;
